    this.state={
      items:[],
      flag:false
    }
  }


async componentDidMount(){
  axios.get('http://localhost:5000/')
  .then((response)=>{
    console.log(response.data.countries)
    this.setState({items:response.data.countries,flag:true})})
  .catch((err)=>console.log(err))






